import React, {
    useEffect,
    useState
} from 'react'

import 'firebase/auth'
import 'firebase/app'
import 'firebase'
import { render } from '@testing-library/react'
import './gifaby.css'
import { user } from './redux/reducers/user'
import { Helmet } from 'react-helmet'
import newuser from './newuser'
import { Modal, Button } from 'react-bootstrap'
import Feed from './Feed'
import Avatar from '@material-ui/core/Avatar'
import firebase from 'firebase'
const firebaseConfig = {
    apiKey: "AIzaSyAl_fbPDKuFkNsP9l0bXfvP5UY99YaKZaE",
    authDomain: "gifaby-9c6aa.firebaseapp.com",
    databaseURL: "https://gifaby-9c6aa.firebaseio.com",
    projectId: "gifaby-9c6aa",
    storageBucket: "gifaby-9c6aa.appspot.com",
    messagingSenderId: "26428908",
    appId: "1:26428908:web:fc86009d31da379318acc9",
    measurementId: "G-FZ0KL5JLRH"
  };

  const db = firebase.firestore()
  const auth = firebase.auth()
  const storage = firebase.storage()

  export { db, auth, storage, firebaseConfig }

  if(firebase.apps.length === 0){
    firebase.initializeApp(firebaseConfig)
  }



function Home() {




    const [posts, setPosts] = useState([]);

    useEffect(() => {
        db.collection('posts').onSnapshot(snapshot => {
            setPosts(snapshot.docs.map(doc => doc.data()))
        })
    }, [])

    return (
        <>
            <div className='allbg' >
            <Helmet>
              <title>Gifaby | Home</title>
            </Helmet>
            <nav>
                <div className='navbarh' ></div>
                <div className='logoh'></div>
            </nav>
                <div className='Feed' >
                    {
                        posts.map(post => (
                            <Feed username={post.username} description={post.description} imageUrl={post.imageUrl} />
                        ))
                    }
                </div>

            </div>
        </>


    )
}

export default Home
